llm_command:
bash
kubectl patch networkpolicy allow-frontend-productcatalog -n frontend --type='merge' -p='{
  "spec": {
    "podSelector": {},
    "policyTypes": ["Ingress"],
    "ingress": [
      {
        "from": [
          {
            "podSelector": {
              "matchLabels": {
                "app": "productcatalogservice"
              }
            }
          }
        ],
        "ports": [
          {
            "port": 3550,
            "protocol": "TCP"
          }
        ]
      }
    ]
  }
}'
